    {
        id: 0,
        name: '地点分布'
    },
    // {
    //     id: 1,
    //     name: '景点分布'
    // }
])

const getRandom = () => {
    return Math.round(Math.random() * 100 + 50)
}

const handleChange = async (i: number) => {
    await scenicrestore()
    if (i === 0) {
        // 历史遗留
        // 显示shp选择框
        __g.camera.playAnimation(12)
        showCheck.value = true
        useDialog.setIsShp(true)
        initHistory()
    } else if (i === 1) {
        // 隐藏shp选择框
        showCheck.value = false
        useDialog.setDialogVisible(false)
        useDialog.setIsShp(false)
        cleanHistory()
        scenicSpot()
    } else {
        // 隐藏shp选择框
        __g.heatmap.hide('heatmap')
        showCheck.value = false
        useDialog.setDialogVisible(false)
        useDialog.setIsShp(false)
        cleanHistory()
        __g.camera.playAnimation(12)
        console.log('取消')
    }
}
const useDialog = useDialogStore()
const dialogInfo = useDialog.DialogInfo
onMounted(() => {
    __g.camera.playAnimation(12)
})

onBeforeUnmount(() => {
    // 隐藏shp选择框
    showCheck.value = false
    useDialog.setDialogVisible(false)
    useDialog.setIsShp(false)
    // 还原
    cleanHistory()
    scenicrestore()
    __g.camera.stopAnimation()
})

watchEffect(() => {
    if (!showCheck.value) {
        cleanHistory()
    }
})

